import React, { Component } from "react";
import "./AppNav.css";

class AppNav extends Component {
    constructor(props){
        super(props);

        this.handleLinkRoute = this.handleLinkRoute.bind(this);
    }

    handleLinkRoute(event){
        event.preventDefault();

        const route = event.target.route;
        console.log(event.target);
        console.log(route);
        this.props.switchContentFromRoute(route);
    }

    render() {
        return (
            <nav>
                <ul>
                    <li><a href="#" route="shop" onClick={e => this.handleLinkRoute(e)}>Shop</a></li>
                    <li><a href="#" route="login" onClick={e => this.handleLinkRoute(e)}>Login</a></li>
                    <li><a href="#" route="register" onClick={e => this.handleLinkRoute(e)}>Register</a></li>
                </ul>
            </nav>
        );
    }
}

export default AppNav;
